  false,\n\t\"url\": null,\n\t\"notes\": \"During the past few years the two pools
  at Montezuma National Wildlife Refuge have become heavily infested with Carp. These
  fish enter the pools over the tops of spillways, through equalizers and occasionally
  over the dikes at the time of spring floods. Then three successful spawning seasons
  populated the pools with carp to the point where stringent control measures were
  imperative. These undesirable fish had destroyed a large proportion of the natural
  and planted aquatics. This report outlines the steps that were taken to minimize
  the populations of this nuisance fish.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
